class AnalogClock extends HTMLElement{
constructor(){
    super()
    // webp to data
    // https://base64.guru/converter/encode/image/webp
    const sheet = new CSSStyleSheet();
    sheet.replaceSync(
        `
        div{
            width:80%;
            height:80%;
            background-position: center center;
            background-size: cover;           
        }
        .container{
            width:100%;
            height:100%;
            overflow:hidden
        }
        .wrapper{  
            width:90%;
            height:90%;          
            position: relative;
           
        }
        .wrapper>div{
            position: absolute;
        }

        .city{
            position:relative;
            text-align:center;
            font-size:5rem;
        }

        .szamlap{   background-image: url('data:image/webp;base64,');}
        .mp{   background-image: url('data:image/webp;base64,');}
        .perc{   background-image: url('data:image/webp;base64,');}
        .ora{   background-image: url('data:image/webp;base64,');}          
        `
    )
    
    let timeshift=0
    if (this.dataset.timeshift){
        timeshift=Number(this.dataset.timeshift)
    }

    let ido=new Date()
    ido.setHours(ido.getHours()+timeshift)
    let second = ido.getSeconds()

    let mp= document.createElement('div')
    mp.className="mp"
    mp.style="transform:rotate("+second*6+"deg)"

    let perc = document.createElement('div')
    perc.className="perc"
    let minute = ido.getMinutes()
    perc.style="transform:rotate("+(minute*6+second*0.1)+"deg)"

    
    let ora = document.createElement('div')
    ora.className="ora"
    let hour = ido.getHours()
    ora.style="transform:rotate("+(hour*30+minute/2)+"deg)"

    let szamlap = document.createElement('div')
    szamlap.className="szamlap"
    


    let wrapper = document.createElement('div')
    wrapper.className="wrapper"
    wrapper.appendChild(szamlap)
    wrapper.appendChild(mp)
    wrapper.appendChild(perc)
    wrapper.appendChild(ora)
    
    let container = document.createElement('div')
    container.appendChild(wrapper)    

    if (this.dataset.city){
        let city = document.createElement('div')
        city.className="city"
        city.innerHTML=this.dataset.city
        container.appendChild(city)
    }

    const shadow= this.attachShadow({mode:'open'})
    shadow.adoptedStyleSheets=[sheet]
    shadow.appendChild(container)

    setInterval(function(){
        let ido=new Date()
        ido.setHours(ido.getHours()+timeshift)
        // ido.setSeconds(ido.getSeconds()+1) // teszt mód
        let second = ido.getSeconds()
        mp.style="transform:rotate("+second*6+"deg)"
        
        let minute = ido.getMinutes()
        perc.style="transform:rotate("+(minute*6+second*0.1)+"deg)"
        
        let hour = ido.getHours()
        ora.style="transform:rotate("+(hour*30+minute/2)+"deg)"
    },10)
    }
}

customElements.define('analog-clock',AnalogClock)